package programs;

public class MyThread1 extends Thread{
	PrintValues p;
	
	public MyThread1(PrintValues p) {
		// TODO Auto-generated constructor stub
		this.p=p;
	}
	
	public void run(){
		try {
			p.displayNumber();
		} catch (InterruptedException e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		}
	}
}
